import React, { Component } from "react";
// import LoginForm from "./LoginForm/LoginForm";
import "./HeaderComponent.scss";
class HeaderComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return <div>Header Works</div>;
  }
}

export default HeaderComponent;
